    function addEventHandlers() {
        jQuery('#recorder-menu').on('click', '#recorder-start', function (e) {
            sendCommand('StartRecording')
                .done(function () {
                    jQuery('#recorder-start').prop('disabled', true);
                    jQuery('#recorder-stop').prop('disabled', false);
                    startTimer();
                })
                .fail(function () {
                    jQuery('#recorder-start').prop('disabled', false);
                    jQuery('#recorder-stop').prop('disabled', true);
                    stopTimer();
                });
            startTimer();
        });

        jQuery('#recorder-menu').on('click', '#recorder-stop', function (e) {
            sendCommand('StopRecording')
            .done(function () {
                jQuery('#recorder-start').prop('disabled', false);
                jQuery('#recorder-stop').prop('disabled', true);
                stopTimer();
            })
            .fail(function () {
                jQuery('#recorder-start').prop('disabled', true);
                jQuery('#recorder-stop').prop('disabled', false);
                stopTimer();
            });
        });

        jQuery('#recorder-menu').on('click', '.recorder-zoom', function (e) {
            _zoomFactor += jQuery(this).data('step');
            drawTrack();
        });
        
        jQuery('#recorder-menu').on('click', '.recorder-rotate', function (e) {
            var step = jQuery(this).data('step');
            if (step === 0) {
                _rotation = 0;
            } else {
                _rotation += step;
            }
            drawTrack();
        });
        
        jQuery('#track-recorder-left').on('click', '.trackinfo', function () {
            _selectedLap = jQuery(this).data('index');
            drawTrackInformation();
        });

        jQuery('input[name=track-points]').on("change", function () {
            drawTrack();
        });
    }

    function sendCommand(command) {
        var deferred = jQuery.Deferred();
        jQuery.ajax({
            url: _uri + 'TrackRecorder',
            cache: false,
            method: 'POST',
            data: {
                action: command
            }
        }).success(function (result) {
            if (result.Result === true) {
                deferred.resolve(result);
            } else {
                deferred.fail();
            }
        }).fail(function () {
            deferred.fail();
        });

        return deferred.promise();
    }

    function startTimer() {

        if (_timer === null) {
            _timer = jQuery.timer(_timeout, function () {

               /* sendCommand('GetTrackRecording')
                    .done(function (result) {
                        _trackRecordingData = result;
                        drawTrackInformation();
                    })
                    .fail();
                 */   

                _trackRecordingData = result5m;

                drawTrackInformation();


            });
        }
        _timer.resume();
        _timer.trigger();

    }

    function stopTimer() {
        _timer.stop();
    }

    function drawTrackInformation() {

        var html = '';
        if (_trackRecordingData !== null) {
            jQuery.each(_trackRecordingData.TrackRecording.TrackLaps, function (index, trackLap) {
                html += '<button type="button" class="expanded button trackinfo" data-index="' + index + '">Lap ' + trackLap.Lap + ' Points ' + trackLap.TrackPoints.length + '</button>';
            });
        } else {
            html = '<div class="callout alert">\
                        <h5>No Laps Available</h5>\
                        <p>Please Record some laps.</p>\
                    <div>';
        }
        jQuery('#lap-info').html(html);
        setTrackInformationState();
        drawTrack();
    }

    function setTrackInformationState() {
        if (_selectedLap !== null) {
            jQuery('button[data-index="' + _selectedLap + '"]').addClass('success');
        } else {
            jQuery('.trackinfo').last().addClass('success');
        }
    }

    function drawTrack() {

        if (_trackRecordingData !== null) {
            var trackToDraw = _trackRecordingData.TrackRecording.TrackLaps.length - 1;
            if (_selectedLap !== null) {
                trackToDraw = _selectedLap;
            }
            var trackLap = _trackRecordingData.TrackRecording.TrackLaps[trackToDraw]

            if (trackLap !== undefined) {
                _pointLayer.destroyChildren();
                var points = [];
                jQuery.each(trackLap.TrackPoints, function (index, point) {

                    point = rotate(point, _rotation);
                    points.push(point.X * _zoomFactor);
                    points.push(point.Y * _zoomFactor);

                    if (jQuery('input[name=track-points]').prop('checked') === true) {
                        var circle = new Konva.Circle({
                            x: point.X * _zoomFactor,
                            y: point.Y * _zoomFactor,
                            radius: 4,
                            fill: 'red',
                            stroke: 'black',
                            strokeWidth: 2
                        });
                        _pointLayer.add(circle);
                    }
                });
                var trackMap = new Konva.Line({
                    points: points,
                    stroke: '#ff0000',
                    strokeWidth: 2,
                    lineCap: 'round'
                });
                _trackLayer.destroyChildren();
                _trackLayer.add(trackMap);
                _trackLayer.draw();
                _pointLayer.draw();
            }
        }
    }

    function setupStage() {
        _stage = new Konva.Stage({
            container: '#track-map',
            width: jQuery('#track-map').width(),
            height: jQuery('#track-map').height()
        });
        _trackLayer = new Konva.Layer();
        _carLayer = new Konva.Layer();
        _pointLayer = new Konva.Layer();
        _stage.add(_trackLayer);
        _stage.add(_pointLayer);
        _stage.add(_carLayer);

        resizeStage();
    }

    function resizeStage() {
        var menuHeight = jQuery('#recorder-menu').height();
        var contentHeight = jQuery('#content').height();
        var stageWidth = jQuery('#track-recorder-right').width();

        var stageHeight = contentHeight - menuHeight;

        _stage.size({
            width: stageWidth,
            height: stageHeight
        });
    }

    function rotate(point, a) {

        var xm = (_trackRecordingData.TrackRecording.TrackBounds.Width * _zoomFactor) / 2;
        var ym = (_trackRecordingData.TrackRecording.TrackBounds.Height * _zoomFactor) / 2;
        var cos = Math.cos;
        var sin = Math.sin;
        var a = a * Math.PI / 180;

        var xr = (point.X - xm) * cos(a) - (point.Y - ym) * sin(a) + xm;
        var yr = (point.X - xm) * sin(a) + (point.Y - ym) * cos(a) + ym;

        return { X: xr, Y: yr };
    }

